import React, { Component } from 'react';

class Auth extends Component {
    constructor(props){
        super(props)

        this.state = {
            username: '',
            password: '',
        }
    }

    render() { 
        return ( 
            <div>
                <h1>Auth</h1>
                <form>
                    <label>
                    Username:
                        <input type="text" />
                    </label>
                    <label>
                    Password:
                        <input type="text" />
                    </label>
                </form>
            </div>
         );
    }
}

export default Auth;
